import React from "react";

function Footer() {
    return (
        <div className="m-10 text-sm text-center text-black-500">
            <p>Employee pictures provided by <a href="https://randomuser.me/">Randomuser.Me</a></p>
            <p>Built by <a href="https://loganfmorro.github.io/">Logan Morro</a></p>
        </div>
    )
}

export default Footer;
